import React from 'react';

const Home = () => {
  return (
    <div>
      <h2>Bienvenido a la Aplicación de Demostración</h2>
      <p>
        Usa la navegación de arriba para visitar el 
        Directorio de Usuarios o la Lista de Tareas.
      </p>
    </div>
  );
};

export default Home;
